import Buttons from "../elements/Buttons";
import NumberNGBRUnits from "../inputs/NumberNGBRUnits";
import Inputs from "../inputs/Inputs";

const Step4 = ({
  whichStep,
  setWhichStep,
  customerInputs,
  handleChange,
  handleClick,
  setPADDRegion,
  setCustomerInputs,
}) => {
  return (
    <div className="main container-inputs">
      <h2>Step4</h2>
      <ul className="inputs" id="inputs">
        <li className="column range with-output">
          <NumberNGBRUnits {...{ customerInputs, handleChange, handleClick, edit: 1 }} />
        </li>
      </ul>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs {...{ setPADDRegion, customerInputs, setCustomerInputs }} />
    </div>
  );
};

export default Step4;
